import { Router, Route } from "react-router-dom";
import Authorization from "./components/Autorization/Authorization";

function App() {
  return (
    <Router>
    <div className="App">

        <Route path="/authorization" component={Authorization} />

    </div>
    </Router>
  );
}

export default App;
